from __future__ import absolute_import
from __future__ import division
from __future__ import print_function

import os

# ignore the warning for including GPU usage
os.environ['TF_CPP_MIN_LOG_LEVEL'] = '3'

import sys

import urllib

import numpy as np
import tensorflow as tf
import pandas as pd

# Data sets
TIME_TRAINING = sys.argv[1]

TIME_TEST = sys.argv[2]

COLUMNS = ["ts_0","ts_1","ts_2","Type"]
CATEGORICAL_COLUMNS = ["ts_0","ts_1","ts_2"]
CONTINUOUS_COLUMNS = []
LABEL_COLUMN = "Type"

# Load datasets.
df_train = pd.read_csv(TIME_TRAINING, names=COLUMNS, skipinitialspace=True)
df_test = pd.read_csv(TIME_TEST, names=COLUMNS, skipinitialspace=True)

col_ts_0 = tf.contrib.layers.sparse_column_with_integerized_feature("ts_0", bucket_size=144)
col_ts_1 = tf.contrib.layers.sparse_column_with_integerized_feature("ts_1", bucket_size=144)
col_ts_2 = tf.contrib.layers.sparse_column_with_integerized_feature("ts_2", bucket_size=144)

feature_columns = [tf.contrib.layers.embedding_column(col_ts_0, dimension=144),tf.contrib.layers.embedding_column(col_ts_1, dimension=144),tf.contrib.layers.embedding_column(col_ts_2, dimension=144)]

def input_fn(df, train=False): #, train=False
  """Input builder function."""
  # Creates a dictionary mapping from each continuous feature column name (k) to
  # the values of that column stored in a constant Tensor.
  continuous_cols = {k: tf.constant(df[k].values) for k in CONTINUOUS_COLUMNS}
  # Creates a dictionary mapping from each categorical feature column name (k)
  # to the values of that column stored in a tf.SparseTensor.
  categorical_cols = {k: tf.SparseTensor(
    indices=[[i, 0] for i in range(df[k].size)],
    values=df[k].values,
    dense_shape=[df[k].size, 1])
      for k in CATEGORICAL_COLUMNS}

  # Merges the two dictionaries into one.
  feature_cols = dict(continuous_cols)
  feature_cols.update(categorical_cols)
  # Converts the label column into a constant Tensor.
  if train:
    label = tf.constant(df[LABEL_COLUMN].values)
    # Returns the feature columns and the label.
    return feature_cols, label
  else:
    # so we can predict our results that don't exist in the csv
    return feature_cols

# Build 3 layer DNN with 10, 20, 10 units respectively.
#LinearRegressor(feature_columns=feature_columns)
classifier = tf.contrib.learn.DNNClassifier(feature_columns=feature_columns,
                                            hidden_units=[10, 20, 10],
                                            n_classes=8,
                                            optimizer="Adagrad") #Ftrl, RMSProp, Adam, Adagrad, SGD, Momentum

#,model_dir="/tmp/time_use"

# Fit model.
classifier.fit(input_fn=lambda: input_fn(df_train, True), steps=2000)

# Evaluate accuracy.
evaluation = classifier.evaluate(input_fn=lambda: input_fn(df_test, True),
                                     steps=1)

accuracy_score = evaluation["accuracy"]

# print(evaluation)
print("\nTest Accuracy: {0:f}\n".format(accuracy_score))

